import Searchbar from './components/Searchbar';
import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Redirect,
} from "react-router-dom";
import Getresult from './components/Getresult';

function App() {
  return (
    <div className="App">
      <h1>Find brewery from football game</h1>
      <div>
      <Router>
        <Switch>
          <Route exact path="/" component={Searchbar} />

          <Route path="/details" component={Getresult} />

        </Switch>
      </Router>
    </div>
    </div>
  );
}

export default App;
